# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - io.StringIO~Subclass
    - paramiko
    - Member[config].Member[StringIO]
  - - io.StringIO~Subclass
    - paramiko
    - Member[file].Member[BytesIO]
